('1901267', '2019-07-05', 'Aura Bulan izzati', '', '', '', '', '081330300672', 'no@email', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking kids 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'AMG', 'regular', 0, '2020-07-05', 0, NULL, NULL, NULL, 3, 'She has range of vocabularies use when she was having conversation with her classmate, she also knows the basic structure of English to speak. However, she needs to practice more to have better English structure. So, she has to keep her practicing both in the English class or outside the classroom to help her speak in length. In this case, parents can help to control and to support to the daughter to elaborate her English at home by having small dialog using English. ', 'aktif', NULL, 'EC-20180356275'),
