('1902266', '2019-07-06', 'FAREL ABIO WINATA', '', '', '', '', '087852713537', 'Farel@gmail.com', 'student smpn 18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking teens 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'regular', 0, '2020-01-06', 0, NULL, NULL, NULL, 3, 'Farel memiliki kemampuan untuk menangkap pelajaran dengan baik hanya saja konsentrasi Farel mudah tergganggu oleh keberadaan temannya namun pada dasarnya dia adalah anak yang pintar. Pada awalnya Farel memiliki kesulitan untuk merangkai kalimat bahkan menggunakan to be namun seiring berjalannya treatment Farel sudah dapat menyusun simple sentence meski terkadang mengalami kesulitan dalam penggunaan to be is/ are. Farel sudah dapat mengekspresikan kegiatan yang ia lakukan sehari-hari dengan bahasa yang berterima, ia juga sudah dapat mengaplikasikan present continous namun terkadang ia masih kesulitan ketika harus mengubahnya kedalam bentuk negativ   Farel mudah dapat mengaplikasikan yang telah dia pelajari dengan mudah, namun terkadang ia kurang memiliki kepercayaan diri untuk mengekpresikan apa yang telah ia pelajari. Untuk perkembangannya, Farel membutuhkan English environment untuk menerapkan kosa kata yang telah ia pelajari karena terkadang ia lupa kosa kata yang telah diberikan sehingga perlu diterapkan pada kehidupan sehari-hari. Secara keseluruhan Farel memiliki potensi besar untuk mengembangkan kemampuan bahasa inggrisnya. ', 'aktif', NULL, 'EC-20170457130'),
