('1902631', '2019-10-26', 'Tria Budiana', NULL, NULL, NULL, NULL, '00', 'triabud@gmail.com', 'wiraswasta', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking teens 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'regular', 0, '2020-02-26', NULL, NULL, NULL, NULL, 3, '', 'aktif', NULL, 'EC-20170457130'),
('1902632', '2019-10-13', 'fattah rosady', NULL, NULL, NULL, NULL, '00', 'fattahrosady@gmail.com', 'its', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking adults 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'regular', 0, '2019-02-26', NULL, NULL, NULL, NULL, 3, '', 'aktif', NULL, 'EC-20170457130'),
('1902633', '2019-10-26', 'allesya', NULL, NULL, NULL, NULL, '0', 'alesya@gmail.com', 'TK A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking kids 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2020-03-26', NULL, NULL, NULL, NULL, 3, 'Alesha is a student who an absorb the material in an excellent way. Most of the time, she has no difficulty in the learning process. Beside her liveliness in learning process, she also shows a critical thinking. It means that, she doesn\'t only receive the materials but she processed it then produce a question about it. In some cases, she bravely asks whenever she doesn\'t know the English vocabulary. The aspect that needs to enhance is her capability to arrange a longer sentence and some practical daily conversation in English. Overall, she is ready to learn in he higher level such as FF1. ', 'aktif', NULL, 'EC-20170457130'),
('1902634', '2019-10-26', 'khalisaa', NULL, NULL, NULL, NULL, '0', 'khalisa@gmail.com', 'sd', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking kids 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2020-02-26', NULL, NULL, NULL, NULL, 3, 'Khalisa is considered as a student with quick understanding but overall she needs to pay attention to her surrounding and try to listen her friends opinion. In addition, she is quite competitive while we have some games as energizer at class. ', 'aktif', NULL, 'EC-20180256040'),
('1902635', '2019-10-26', 'alawi bayu bening', NULL, NULL, NULL, NULL, '1', 'alawiii@gmail.com', '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking kids 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2020-02-26', NULL, NULL, NULL, NULL, 3, 'Alawi can absorb the knowledge from the surrounding by imitating and repeating the spoken sentence from the coaches. Day by day, he becomes more confident to interact with other classmates. The most important development from him is the way he ask if he doesn\'t understand some vocabulary. Alawi will have a better speaking skill by continue to immitate and repeat. ', 'aktif', NULL, 'EC-20190764054'),
('1902636', '2019-10-26', 'mirza', NULL, NULL, NULL, NULL, '0', 'mirzaa@gmail.com', 'SD', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking kids 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2020-02-26', NULL, NULL, NULL, NULL, 3, 'In the classroom, he is very active in class activity whether asking and answering a question given by the coach. Mirza also a very cooperative students who understands the order and follows the class agreement. One thing that he needs to improve is the way he speaks in a longer sentence using complete structure. In this case, he needs to keep practicing the conversation.', 'aktif', NULL, 'EC-20190764054'),
