('1902697', '2019-11-02', 'ALFIZ', NULL, NULL, NULL, NULL, '0', 'ALFIZ@GMAIL.COM', '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking kids 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2020-07-02', NULL, NULL, NULL, NULL, 3, 'Alfiz is very active and curious about everything. He loves challenge and new knowledge. However, he often relucant to speak English at first if there is no push from the others. When the first time Alfiz studied here, he was quite moody, but now he become more confident and help his friends. He is capable of producing a sentence and answering question. Congratulations for leveling up to FF2!', 'aktif', NULL, 'EC-20170457130'),
('1902698', '2019-02-07', 'FINA', NULL, NULL, NULL, NULL, '0', 'FINA@GMAIL.COM', '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking teens 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2019-02-11', NULL, NULL, NULL, NULL, 3, 'At first, Fina is very shy and timid, but day by day, she keeps improving in her confidence, and she can speak about many topics regarding herself. She is also very attentive at class and love to learn new things. However, she needs to improve her way to produce complete sentence and speak in a loud voice', 'aktif', NULL, 'EC-20170457130'),
