('1902801', '2019-11-29', 'annisa alya', NULL, NULL, NULL, NULL, '0', 'ANISSA@GMAIL.COM', '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking teens 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2020-02-29', NULL, NULL, NULL, NULL, 3, 'Dapat dikatakan bahwa Alya adalah anak yang pintar, namun ia cenderung untuk tidak mengekspresikan idenya secara bebas padahal Alya memiliki kemampuan yang sudah cukup bagus. Untuk penguasaan structure, Alya sudah banyak berkembangih kreatif dalam menyusun kalimat meskipun dalam penggunaanya masih terdapat minor mistakes namun hal tersebut bukanlah halg serius mengingat Alya dapat melajari hal baru dan mengaplikasikannya dengan mudah. Perlu diketahui bahwa bahasa adalah tentang konsistensi dalam berlatih jika ingin mendapatkan hasil yang baik. Terus berkembang Alya, you have a big potential to develop your English!', 'aktif', NULL, 'EC-20170457130'),
('1902802', '2019-11-29', 'ABIL', NULL, NULL, NULL, NULL, '0', 'ABILZ@GMAIL.COM', '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking teens 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2020-02-29', NULL, NULL, NULL, NULL, 3, '\nSelama treatment, Abil mengalami peningkatan percaya diri yang sangat baik. Pada awalnya, ia sangat pemalu dalam mengekpresikan ide-ide dan menjawab pertanyaan namun lambat laun, kepercayaan dirinya mulai terbangun. Abil juga anak yang aktif didalam kelas, ia juga memiliki kemampuan intrapersonal yang baik dengan teman-temannya sehingga dapat membaur dan bertukar pikiran dengan baik. Terlepas dari softskill yang Abil miliki, secara skill Abil sudah memiliki fluency yang baik. Ia dapat menyusun kalimat dengan berterima, hanya saja kosa kata Abil perlu diupgrade lagi. Sebenarnya Abil sudah menguasai beberapa tenses yang diajarkan, namun karena tidak terbiasa digunakan sehingga pada prakteknya Abil cenderung menggunakan tenses yang monoton. Untuk menanggulangi hal ini, perlu diciptakan English environment untuk Abil agar dapat berkembang lebih baik lagi. Sedangkan untuk pelafalan setiap kata atau pronunciation, Abil sangat perlu banyak berlatih lagi, karena Abil cenderung mengesampingkan ketepatan pelafalan meski bunyi yang dihasilkan sudah baik. Secara keseluruhan, Abil memiliki potensi yang sangat besar untuk terus mengembangkan kemampuan bahasa inggrisnya sehingga menjadi lebih baik lagi. \n', 'aktif', NULL, 'EC-20170457130'),
