('1902941', '2019-12-23', 'ALIFAH NUR AINI', NULL, NULL, NULL, NULL, '081336445400', 'a@gmail.com', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday TOEFL', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'holiday', 24, '2020-03-23', NULL, NULL, NULL, NULL, 3, 'Miss Alifah has great willingness to follow the materials well however sometimes you don\'t focus and think too hard. From the three sections in TOEFL, you are good in reading but you still need to boost your vocabulary. While for the structure, you still need to focus and pay attention more on the details thus you don\'t miss anything and can choose the correct answer. You also need to improve your listening skill. You will master TOEFL if you keep practicing and have strong determination to master it. Keep it up Miss Alifah.', 'aktif', NULL, 'EC-20170457130'),
('1902942', '2019-12-23', 'Ika Nur Aini', NULL, NULL, NULL, NULL, '087853463359', 'a@gmail.com', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'speaking adults 1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'reguler', 24, '2019-12-23', NULL, NULL, NULL, NULL, 3, '', 'aktif', NULL, 'EC-20170457130'),
('1902943', '2019-12-23', 'A\'qotrunnada Khalishah Ismaini', NULL, NULL, NULL, NULL, '081234577122', 'a@gmail.com', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday TOEFL', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Pucang', 'holiday', 24, '2019-12-31', NULL, NULL, NULL, NULL, 3, 'I can see your high spirit since the beginning. You can do the skills well yet you need more practices. You can follow the class and the materials well but you usually make mistakes because you are not thorough. You just need to be more thorough and pay attention on the details then you are all good especially in terms of grammar and reading. You also need to enrich your vocabulary thus it will help you in doing the reading section. I know you can do it better. ', 'aktif', NULL, 'EC-20170457130'),
