('1904132', '2019-12-23', 'Muhammad xavier alfarizi', NULL, NULL, NULL, NULL, '087851517386', 'subdomain@gmail.com', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Well done xavier! Xavier anak yang aktif dan selalu bersemangat menjawab pertanyaan coach ketika dia mengetahui jawabannya. Selalu berusaha menghafalkan meskipun kadang ter distract dengan hal lain. :) mungkin masih perlu belajar lagi untuk memahami instruction dari coach dalam bahasa inggris. Keep studying dan perbanyak vocab vocab baru ya xavier. :)', 'aktif', NULL, 'EC-20191111443'),
('1904133', '2019-12-23', 'Nararya Tsaqif Hilmiansyah', NULL, NULL, NULL, NULL, '081553006048', 'subdomain@gmail.com', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Great job hilmi! You did good. Selalu bersemangat mengikuti pembelajaran dan game. Slalu aktif menjawab dan bertanya. Selalu berusaha menghafalkan surat surat pendek. Namun mungkin masih perlu belajar hasa inggris lebih untuk memahami kalimat dalam bahasa inggris. Masih perlu ditingkatkan juga fokus nya. Keep studying and collect more vocabulary :)', 'aktif', NULL, 'EC-20191111443'),
('1904134', '2019-12-23', 'Gabriella Naura Sakhi', NULL, NULL, NULL, NULL, '082141868718', 'subdomain@gmail.com', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Well done gabby! Selalu mendengarkan coach instruction dengan seksama. Selalu aktif menjawab ketika mengetahui jawaban dan berani bertanya kepada coach. Mungkin perlu belajar juga untuk vocab vocab baru dalam bahasa inggris untuk membantu memahami instruksi dan juga belajar bagaimana menulis kata bahasa inggris. Keep studying gabby. You did good :)', 'aktif', NULL, 'EC-20191111443'),
('1904135', '2019-12-23', 'Wanodya Satya Ainiyyah', NULL, NULL, NULL, NULL, '6281357268723', 'subdomain@gmail.com', 'SD Khadijah 3', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Nody.. You did a good job for the last week.. Nody bisa mengikuti setiap materi yang diajarkan.. begitu pula setiap kegiatan yang dilakukan.. Nody hanya perlu untuk lebih percaya diri lagi saat menggunakan bahasa Inggris.. Juga belajar kosakata baru akan sangat membantu Nody.. so, Keep on learning and stay positive!	', 'aktif', NULL, 'EC-20191111443'),
('1904136', '2019-12-23', 'Muhammad Daffa Alif Ramadhan', NULL, NULL, NULL, NULL, '083856917117', 'subdomain@gmail.com', 'SDIT Usman bin Affan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, 'daffahanna', NULL, NULL, 3, 'Well done Daffa..! You\'re such a nice boy.. tidak terasa sudah 4 hari lebih Daffa belajar dan bermain di TAF Holiday.. Daffa sudah tau banyak hal dan bertemu banyak kawan baru.. Daffa juga sudah punya modal bagus untuk menjadi lebih baik dalam berbahasa Inggris.. Daffa punya attitude yang bagus dan semangat belajar yang tinggi.. Sekarang tinggal Daffa yang harus meneruskan, tetaplah menjadi yang terbaik dan jaga semangatmu! Wish you have a great future ahead!', 'aktif', NULL, 'EC-20191111443'),
('1904137', '2019-12-23', 'Faustina Hafit Rafani', NULL, NULL, NULL, NULL, '6281331577487', 'subdomain@gmail.com', 'SDI Al-Mizan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Hi Faustina.. Sudah hampir seminggu kamu belajar dan bermain di TAF Holiday.. dan seperti biasanya, kamu selalu aktif di dalam tiap kesempatan. Yang perlu kamu lakukan adalah meningkatkan skill dalam struktur dan kefasihan dalam berbahasa Inggris, mengingat kamu cukup sering mencampur bahasa  Inggris dengan Indonesia.. Jadi untuk kedepannya lebih konsisten lagi ya.. juga kamu harus memperhatikan lagi penggunan tobe yang tepat dalam tiap kalimat. Alright.. So, keep on learning and stay positive!', 'aktif', NULL, 'EC-20191111443'),
('1904138', '2019-12-23', 'Gibran Naufal Alfarizky', NULL, NULL, NULL, NULL, '085850053332', 'subdomain@gmail.com', 'SD Khadijah 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Naufal.. You did a good job! Naufal punya rasa ingin tahu dan kemauan untuk aktif di dalam setiap kegiatan. Hal itu bisa ia jadikan pondasi untuk menjadi penuntut ilmu yg cemerlang, hanya perlu untuk lebih konsisten dalam belajar. What a good boy you are Naufal! ', 'aktif', NULL, 'EC-20191111443'),
('1904139', '2019-12-23', 'Muhammad Maula Riffat', NULL, NULL, NULL, NULL, '6287851517386', 'subdomain@gmail.com', 'SD Khadijah 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Hello Riffat.. It\'s been a half week since you are in TAF Holiday.. Riffat sudah belajar banyak hal dan bertemu kawan baru. Riffat juga punya modal bagus dalam mengembangkan skillnya.. yaitu keingintahuan dan semangat belajar yang tinggi yang kamu miliki. Jadi, sekarang hanya Riffat yang mampu meneruskan dan mengembangkan landasan tersebut. Teruslah belajar dan tetap semangat ya Riffat..! Keep moving on! (y)', 'aktif', NULL, 'EC-20191111443'),
('1904140', '2019-12-23', 'Abdul Malik Prasandi', NULL, NULL, NULL, NULL, '081332840474', 'subdomain@gmail.com', 'SD Khadijah 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Well done Malik..! Kesan kami selama Malik mengikuti kegiatan di TAF Holiday.. Dia mempunyai attitude yg bagus, dia punya inisiatif untuk membantu sesama. Dengan modal tersebut, Malik bisa menjadi pribadi yg baik.. Terutama dalam mempelajari banyak hal, salah satunya Bahasa Inggris. Atta boy..! ', 'aktif', NULL, 'EC-20191111443'),
('1904141', '2019-12-23', 'Nayyara Arsyah Al Fayyaza', NULL, NULL, NULL, NULL, '6289533830366', 'subdomain@gmail.com', 'SD Khadijah 3', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Azza.. you did a good job.. Azza sudah bisa mengikuti setiap kegiatan seminggu terakhir ini.. Azza hanya perlu meningkatkan kepercayaan dirinya dalam menggunakan bahasa Inggris, tak perlu ragu ataupun takut salah.. Jadi, terus semangat Azza.. keep it positive!', 'aktif', NULL, 'EC-20191111443'),
('1904142', '2019-12-23', 'Hikmah Nur Jadidah', NULL, NULL, NULL, NULL, '082331454193', 'subdomain@gmail.com', 'SD Khadijah 3', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Hi Jaidah.. it\'s been a half week.. sudah 4 hari Jaidah menghabiskan waktu liburan di TAF Holiday.. Jaidah sudah bertemu banyak teman baru.. dan Jaidah juga sudah belajar banyak hal baru. Jaidah sendiri punya modal yang bagus untuk mengembangkan skillnya, mulai dari structure, vocabulary, hingga pronunciation.. dan sekarang tinggal Jaidah yang harus terus belajar dan mengembangkan setiap skillnya.. Jadi, tetap semangat Jaidah.. Don\'t ever give up to learn!', 'aktif', NULL, 'EC-20191111443'),
('1904143', '2019-12-23', 'Attarsyah Aqeela Prasandi', NULL, NULL, NULL, NULL, '081332840474', 'sub@domain.com', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Great job, Attar! Selalu tertarik untuk belajar sambil bermain game di kelas. Tetap belajar untuk kosa kata bahasa inggris ya attar. Collect more vocabulary to help you speak up more in english. Lebih aktif lagi dalam berpartisipasindi kelas ya.. and no need to be shy. Jangan malu dan ragu untuk bertanya. Keep practicing and studying. :)', 'aktif', NULL, 'EC-20191111443'),
('1904144', '2019-12-23', 'Ain Nun Lam Alifiya', NULL, NULL, NULL, NULL, '082331454193', 'subdomain@gmail.com', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Goodjob alifya! Alifya sangat aktif dan slalu cheerful dikelas. Sangat interest ketika sesi mewarnai dan menggambar. Vocabulary da good pronunciation juga dia terapkan ketika melihat gambar meskipun alifya belum mahir membaca. Sopan sekali ketika meminta tolong. :) namun kadang less focuse ketika bosan. Masih belum memahami juga ketika coach memberikan instruction in english. dan mengalami kesulitan pada hafalan surat al-falaq. Overall, she is great :) keep studying alifya.', 'aktif', NULL, 'EC-20191111443'),
('1904145', '2019-12-23', 'Mutia Agustina', NULL, NULL, NULL, NULL, '081357268732', 'sub@domain.com', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Well done Mutia! You are really hard worker. Selalu mau berusaha mengerjakan dan memberikan yang terbaik di setiap pembelajaran. Really great listener. Slalu mendengarkan instruksi coach dengan baik. SElalu bersemangat erpartisipasi menjawab dan bertanya. Mudah memahami juga. But still you have to study more about english. Masih harus belajar lebih banyak lagi tentang vocab dan pronunciation. Also tentang menulis kata in english. Keep studying mutia :)', 'aktif', NULL, 'EC-20191111443'),
('1904146', '2019-12-23', 'Alkhalifi Zikri Pratama', NULL, NULL, NULL, NULL, '081213847110', 'sub@domain.com', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Great, zikri! Zikri Selalu menjawab dengan bersemangat ketika mengetahui jawabannya. Selalu aktif berpartisipasi dlam pembelajaran. Namun zikri tidak terlalu aktif bertanya. Zikri perlu belajar lagi dan mengkoleksi lebih banyak vovab untuk memahami ucapan atau instruction in english. Perlu lebih memotivasi diri juga untuk menghafal :) overall you did good. Keep studying zikri :)', 'aktif', NULL, 'EC-20191111443'),
('1904147', '2019-12-23', 'Natasya Azhara', NULL, NULL, NULL, NULL, '081335348387', 'sub@domain.com', 'Pelajar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids A', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'Manukan', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Great, natasya! Sangat bersemangat ketika menjawab pertanyaan yang natasya tau dan selalu berpartisipasi dalam pembelajaran dengan baik. Mengetau cukup banyak vocab namun mungkin ada beberapa yang lupa. Have quite good pronunciation. Namun mungkin sering bad mood di awal kelas :). Dan kadang kadang less focus ketika bosan. But it\'s okay. Keep studying ya natasya. Perbanyak vocabulary untuk lebih memahami kalimt atau ucapan dalam bahasa inggris.', 'aktif', NULL, 'EC-20191111443'),
