('1905087', '2020-01-06', 'Arinda Asparin', NULL, NULL, NULL, NULL, '085784788795', 'arindaasparin04@gmail.com', 'Mahasiswa UPN', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Basic English', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'GKB', 'holiday', 24, '2020-01-11', NULL, NULL, NULL, NULL, 3, '', 'aktif', NULL, 'EC-20190126335'),
('1905088', '2019-12-23', 'Aira Putri Azkadina', NULL, NULL, NULL, NULL, '081249666705', 'a@a.a', 'SD Made 4 Lamongan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'GKB', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Kemampuan berbahasa Inggris Aira memang masih belum sempurna tapi dalam seminggu ini Aira menunjukkan kemauan belajar yang sangat tinggi. Aira tidak menyerah meskipun kemampuannya masih jauh di bawah kawan-kawan sekelasnya. Dalam kata lain, Aira adalah fast learner and hard worker. Cara belajar Aira adalah parotting yaitu menirukan apa yang dikatakan oleh coach maupun teman-temannya\nMaka dari itu, sangat disarankan agar Aira dapat melanjutkan pembelajaran di kelas reguler setiap hari sabtu. ', 'aktif', NULL, 'EC-20190555310'),
('1905089', '2019-12-23', 'Essensa Haqquemulya', NULL, NULL, NULL, NULL, '082221803185', '', 'MI Unggulan Sabilillah', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'GKB', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Eza memiliki kemampuan di atas rata-rata dan dia memahami frasa seperti \"I don\'t mind\". Eza juga memiliki kosakata yang kaya dan beragam. Selain itu dia mampu menggunakannya dengan benar dan sesuai konteks. Hal yang perlu ditingkatkan dari Eza adalah untuk mengontrol emosi dan intonasi dalam berbicara. Interaksi dengan teman yang se-frekuensi dan memiliki kemampuan yang sama akan sangat membantu gaya belajar Eza yang cenderung aktif dalam berbicara dan suka menggunakan gerakan.', 'aktif', NULL, 'EC-20190555310'),
('1905090', '2019-12-23', 'Burhan Shabir Sabri', NULL, NULL, NULL, NULL, '082132228342', '', 'SD Made 4 Lamongan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'GKB', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Burhan memiliki kemampuan speaking yang tidak perlu diragukan lagi. Untuk menambah kosakatanya Burhan perlu membahas beberapa topik baru.\nDalam hal bersosialisasi, Burhan tidak ragu untuk memulai koversasi namun terkadang perlu untuk mengontrol waktu bercanda dan belajar. Dalam hal writing, Burhan perlu beberapa kali latihan. Overall, Burhan hanya membutuhkan banyak topik baru untuk dibahas', 'aktif', NULL, 'EC-20190555310');
