('1905091', '2019-12-23', 'Bilbina Azzahra', NULL, NULL, NULL, NULL, '082132221874', '', 'SD Lamongan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'GKB', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Bilbina sudah menunjukkan antusiasnya dalam belajar, dia selalu menanyakan hal yang tidak diketahui. Bilbina juga selalu berusaha menjawab pertanyaan dan memiliki sikap kompetitif saat bermain game edukatif. Bilbina membutuhkan dorongan dari sekitarnya hal tersebut terlihat saat dia merasa malu untuk tampil saat graduation tapi teman-temannya mendukung dan akhirmya Bilbina berani untuk tampil menyanyi.', 'aktif', NULL, 'EC-20190555310'),
('1905092', '2019-12-23', 'Shofi Salsabila', NULL, NULL, NULL, NULL, '082132228342', '', 'SD Made 4 Lamongan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Holiday Kids B', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'undefined', 'GKB', 'holiday', 24, '2019-12-28', NULL, NULL, NULL, NULL, 3, 'Shofi memiliki bekal yang cukup untuk kemampuan speaking. Hal yang perlu dilakukan untuk meningkatkan kemampuan Shofi adalah penggunaan kosakata khusus atau membahas topik-topik baru dan menarik. Shofi juga menunjukkan kepedulian terhadap kawannya jika salah satu dari mereka tidak mengetahui arti dari sebuah kalimat. ', 'aktif', NULL, 'EC-20190555310'),
